import { Component } from '@angular/core';
import { ActivatedRoute, Router } from '@angular/router';

@Component({
  selector: 'app-create-room',
  templateUrl: './create-room.component.html',
  styleUrls: ['./create-room.component.css']
})
export class CreateRoomComponent {
  public user: string = '';
  public userProfile: string= '';
  public roomName: string = '';
  public players: number = 0;

  constructor(private route: ActivatedRoute , private router: Router) {}
  ngOnInit() {
    this.route.queryParams.subscribe((params) => {
      this.userProfile = params['data4'];
    });
    this.route.queryParams.subscribe((params) => {
      this.user = params['userName'];
      console.log(this.user);
    });
}
createBtn(){
console.log('clicked');
    this.router.navigate(['/codeRoom'],{ queryParams: { data4: this.userProfile } });
  }

  onValidate(players: number){
    debugger;
    console.log(players)
  }
}

<div class="container2">
    <!-- <img src="../../assets/images/bg.jpeg" alt="background image" style="width:100%;"> -->
    <div class="centered">
        <div class="circle-container" >
            <img [src]= "userProfile" alt="Photo" class="avtImg">
            <p class = "user">{{ user }}</p>
        </div>
        <input type = "text" placeholder="-Room Name-" class = "playerRoom"  [(ngModel)]="roomName"><br>
        <input type="number" (click)= "onValidate(players)"  name="players" [(ngModel)]="players" 
         maxLength = "1" class = "playerRoom2">
        <button (click) = "createBtn()" class = "createBtn"  [disabled]="!roomName && !players" [ngClass]="{'enabled': roomName && players}" >Create</button>

    </div>   
</div>
